pragma solidity >=0.4.17 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract NFTGame is ERC20, Ownable {
    struct ChristmasChamp {
        uint8 id;
        uint256 damage;
        uint256 health;
        uint256 maxHealth;
        uint8 level;
        uint256 endurance;
        uint256 lasteaten;
        uint256 starvationTime;
        address ownerAddress;
        uint256 feedCost;
    }

    mapping(uint8 => address) public petowners;
    mapping(uint8 => ChristmasChamp) public champs;
    mapping(uint8 => uint8) public petPosition;
    mapping(address => ChristmasChamp[]) public petList;

    uint8 nextId = 0;   
    
    constructor() ERC20("CandyCane", "CC") {

    }

    fallback() external payable {
        uint amount = msg.value;
        _mint(msg.sender, amount / ((totalSupply() + 1) / 10000 * (10 ** 4)));
    }

    function getOwnedChamps(address addr) public view returns(ChristmasChamp[] memory) {
        return petList[addr];
    }
    
    function mint(address addr, uint256 amount) external {
        _mint(addr, amount * (10 ** 18));
    }

    function burn(address addr, uint256 amount) external {
        _burn(addr, amount);
    }

    function dailyReward() public payable {
        uint128 levels = 0;

        ChristmasChamp[] memory owned = petList[msg.sender];

        for(uint i = 0; i<owned.length; i++){
            levels += owned[i].level;
        }

        _mint(msg.sender, levels);
    }

    function getNextId() public view returns (uint8 nextid) {
        nextid = nextId;
    }

    function getChampById(uint8 champId) public view returns (ChristmasChamp memory champ) {
        champ = champs[champId];

        return champ;
    }

    function getLastEatenById(uint8 champId) public view returns (uint256 lasteaten) {
        lasteaten = champs[champId].lasteaten;
    }

    function levelUpChamp(uint8 champId) public view {
        ChristmasChamp memory champ = champs[champId];
        champ.level += 1;
        champ.feedCost += 100;
        champ.maxHealth += 10;
        champ.endurance += 100;
        champ.damage += 10;
        champ.lasteaten = block.timestamp;
        champ.starvationTime = champ.lasteaten + champ.endurance;
    }

    function feed(uint8 champId) public payable {
        ChristmasChamp memory champ = champs[champId];
        require(_balances[msg.sender] >= champ.feedCost / (10**3));
        levelUpChamp(champId);
        champ.health = champ.maxHealth;
    }

    function transferChamp(address from, address to, uint8 champId) public {
        ChristmasChamp memory champ = champs[champId];

        champ.ownerAddress = to;

        delete petList[from][petPosition[champId]];
        
        petList[to].push(champ);
    }

    function createChamp(address recipient) public returns (ChristmasChamp memory) {
        ChristmasChamp storage champ = champs[nextId];

        champ.id = nextId;
        champ.damage = 5;
        champ.health = 100;
        champ.maxHealth = 100;
        champ.level = 1;
        champ.endurance = 10000;
        champ.lasteaten = block.timestamp;
        champ.starvationTime = champ.lasteaten + champ.endurance;
        champ.ownerAddress = recipient;
        champ.feedCost = 25;

        petowners[nextId] = recipient;
        petList[recipient].push(champs[nextId]);

        nextId += 1;

        return champs[nextId - 1];
    }
}
